  import React,{useState,useRef} from 'react';
  import { faArrowRight, faCoffee, faRightLeft } from '@fortawesome/free-solid-svg-icons'
  import  {FoodCard} from './components/card';
  import db from './DB';
import { FestBanner } from './components/banner';
import dimg from "./DB/assets/paper.png"
import mimg from "./DB/assets/Vec.png"


function App() {
  const {weeklySpecial,Topseller,Featured,fest}=db

  return (
    <div className="App">
     <div className='weekly'>

      <img src=''></img>

      <div className='wtext'>
        <p>Weekly Special</p>
        </div>

        <div className='vtext'>
        <p>view all </p>


        <FontAwesomeIcon className='ico'icon={ faArrowRight }></FontAwesomeIcon>   

        </div>


      {
Featured.map((datum)=>{
  return( <FoodCard datum={datum}/> )

})
      }


      </div>

{/* //top */}





      <div className='top'>

      <div className='wtext'>
        <p>Top seller</p>
        </div>



        <div className='vtext'>
        <p>view all </p>


        <FontAwesomeIcon className='ico'icon={ faArrowRight }></FontAwesomeIcon>





        </div>


      {
Topseller.map((datum)=>{
  return( <FoodCard datum={datum}/> )

})
      }


      </div>



      <div className='fea'>


      <div className='wtext'>
        <p>Featured Products</p>
        <img></img>
        </div>





        <div className='vtext'>
        <p>view all </p>


        <FontAwesomeIcon className='ico'icon={ faArrowRight }></FontAwesomeIcon>





        </div>


      {
weeklySpecial.map((datum)=>{
  return( <FoodCard datum={datum}/> )

})
